import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
export default function VolunteerRegistration(){
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [name, setName] = useState('');
    const [age, setAge] = useState('');
    const [address, setAddress] = useState('');
    const [phone, setPhone] = useState('');
    const [type, setType] = useState('');
    const [location, setLocation] = useState('');
    const [eventAssign, setEventAssign] = useState('');
    const [mon, setMon] = useState('');
    const [tues, setTues] = useState('');
    const [wed, setWed] = useState('');
    const [thurs, setThurs] = useState('');
    const [fri, setFri] = useState('');
    const [sat, setSat] = useState('');
    const [sun, setSun] = useState('');
    const [error, setError] = useState('');

    const handleSubmit = (event) => {
        navigate('/volhome')
    }

    return(
        <div className="login-wrapper">
            <h1>Administrator Log In Here</h1>
            <form onSubmit={handleSubmit}>
                <label>
                <p>Email</p>
                <input type="text" onChange={e => setEmail(e.target.value)} />
                </label>
                <label>
                <p>Name</p>
                <input type="password" onChange={e => setName(e.target.value)} />
                </label>
                <div>
                <button type="submit">Submit</button>
                </div>
                {error && <div>{error}</div>}
            </form>

            <br />
            {/* <div>
                <button onClick={handleVolRegister}>Volunteer Registration</button>
                <button onClick={handleVolLogin}>Volunteer Login</button>
                <button onClick={handleAdminRegister}>Admin Registration</button>
            </div> */}
        </div>
    );
}
